import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

// box for parallax 
function Box(props) {
    return (
        <div className={props.cName}>
            <div className="text">
                <h1>Parallax</h1>
            </div>
        </div>
    )

}


// Top level component 
class TopLevel extends React.Component {
    // render parallax box components
    renderBox(name) {
        return (
            <Box
                cName={name}
            />
        );
    }

    render() {
        let i = 0;
        return (
            <div>
                {this.renderBox('box box' + (++i))}
                {this.renderBox('box box' + (++i))}
                {this.renderBox('box box' + (++i))}
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <TopLevel />,
    document.getElementById('root')
);
